            </head>

            <body>
                <h1>Join or Create an RSO</h1>
                {/* JOIN RSO SECTION */}
                <p>Here is a list of all available RSO's:</p>
                <table>
                    <tr>
                        <th>RSO Name</th>
                        <th>Parent School</th>
                        <button>Join</button>
                    </tr>
                </table>
            </body>
        </div>
    )
}
